import React, { useEffect, useState ,useContext} from "react";
import Navbar from "../components/navbar";
import usercontext from "../context/usercontext"
const Home = () => {
  let { user , setUser} = useContext(usercontext)

  const queryuser = () =>{
    user.map((e)=>{
      console.log(e)
    })
  }
  return (
    <div>
      <Navbar />
      <h1>Home</h1>
      <input onChange={queryuser}/>
    </div>
  );
};

export default Home;
